#AUTOVAR(ai) = #AUTOVAR(ai)+1;
#SUBFUNCS(actions)
}

// INTRODUCTION
//
// This map was made to show an example of various Campaign AI control systems.
// It features 3 AI player that use different tools to make units, build tech and send attack waves.
//
// Personality AI player is using personality created in AI module to make units and send attack waves, and preplaced "bullies" to build tech.
// Bully is a special marker present on map that is saying AI that here should be a unit of specific type
//  and AI should try to remake this unit specified number of times.
// AI can build or train specific unit or can use other "free" units to fill the bullies spots,
//  "free" units are units of this player created by any other means that are not bullies and not part of attack waves.
// Unit that is filling this bully spot will be marked as Bully in Unit AI Options.
// For this in my trigger lib I extended AI Options preset that is used in Unit Has AI Option function.
// While I say that Personality is a separate AI system, internally it uses Next Attack Wave trigger actions to send attack waves,
//  and some wave units are just created instantly instead of being made by production buildings.
//
// Stock AI player is using a SetStock trigger actions for construction, training units and doing research.
// While it seems like it uses just one tool for everything, it is actually a very advanced tool used by Melee AI.
// To be consistent with melee-AI-like feeling, this player also uses advanced wave control trigger actions and function to send attack waves
//  and also defends the base with a defense wave.
// These actions are used by Melee AI too, but some of the Melee AI features will not work for Campaign AI.
// This AI also makes use of bulles to rebuild defenses at main choke point.
//
// BuildTrain AI is using Build for construction, Train for unit creation and Research for upgrades.
// While also being advanced, these trigger actions make a separate queues for structures, units and upgrades and I personally like it a lot.
// For attack waves this AI uses "not-advanced" Next Attack Wave trigger actions.
// While saying not advanced, this trigger actions are simple yet more than enough for Campaign mission attack waves.
// "Add Unit Type To Next Wave" action is not present in built-in trigger libs in gui, but it does exists in coop lib,
//  so I included a copy of this trigger action from coop lib into my trigger lib.
// And you can use advanced wave control triggers for these attack waves too.
//
// In current setup BuildTrain AI will usually win here, destroying all other AIs.
// One of the reasons is that it will expand many times and will have more resource income to build army, specifically gas.
// Other reason is that terran and protoss AIs will be fighting each other ignoring zerg most of the time.
// If I give Stock AI more starting resources it will crush everything on the map around game minute 15.
// One of the reason is that this AI already has some starting tech while BuildTrain AI, for example, start with only a bunch of drones.
// Stock AI has a lot of potential, SetStock trigger in this example is pretty simple and not efficient.
// Personality AI seems to be weakest here but it just because it has almost no AI setup at all,
//  so it given an advantage of instantly spawn attack waves that don't require resorces or time to prepare.
// Another this to note, is that AI players in this example don't have infinite resources or supply
//  (AI for Campaign usually has both resources and supply given by triggers)
// In conclusion, mixing various AI control tools can create a very powerful AI for campaign.
//
// CHANGELOG
//
// In version 2.0 I added Campaign dependencies.
// This created some complications because tech tree for zerg and protoss is restricted with ability command states
//  and requirements.
// This was easy to solve for protoss since everything is locked behind one upgrade.
// For zerg I had to make a whole list of upgrades that will enable campaign units.
//
// Added a code for terran AI to expand and take extra gas.
// Now sometimes it can win this, destroying zerg and protoss AIs

int player = lp_player;
unit havoc = lp_havoc;
unitgroup scan_group = lp_scan_group;
const fixed c_forceFieldMeleeRange      = 1.5;
const fixed c_forceFieldRadius          = 2.0;
const fixed c_forceFieldRange           = 8.0;
const fixed c_forceFieldFriendRange     = 9.0;
order force_field_order = AICreateOrder(player, "ForceFieldMonitor", 0);
point havoc_position = UnitGetPosition(havoc);
aifilter filter_ai;
unitgroup ground_enemies;
unitgroup melee_enemy_group;
unitgroup range_enemy_group;
unitfilter filter_unit;
unitgroup friendly_group;
int friendly_count = 0;
unit friendly_unit;
int friendly_vitality = 0;
bool friendly_has_melee = false;
int enemy_count = 0;
unit enemy_unit;
point enemy_position;
fixed enemy_distance;
int best_priority = 0;
point best_enemy_position = null;
point best_friend_position = null;
unit best_target_unit = null;
point force_field_target = null;
// Do not proceed if the order is invalid for some reason
if (!UnitOrderIsValid(havoc, force_field_order)) {
return;
}
// Filter out air units
filter_ai = AIFilter(player);
AISetFilterPlane(filter_ai, c_planeGround);
AISetFilterCanAttackAlly(filter_ai, c_groundAlliesNearby, false);
ground_enemies = AIGetFilterGroup(filter_ai, scan_group);
// Is there a threat in the area
enemy_count = UnitGroupCount(ground_enemies, c_unitCountAll);
if (enemy_count <= 0) {
return;
}
// Get a list of only melee enemies
filter_ai = AIFilter(player);
AISetFilterMelee(filter_ai, c_onlyMelee);
melee_enemy_group = AIGetFilterGroup(filter_ai, ground_enemies);
// Setup a friendly filter
filter_unit = UnitFilter(0,0,0,0);
UnitFilterSetState(filter_unit, c_targetFilterUncommandable,             c_unitFilterExcluded);
UnitFilterSetState(filter_unit, c_targetFilterWorker,                    c_unitFilterExcluded);
UnitFilterSetState(filter_unit, c_targetFilterUnderConstruction,         c_unitFilterExcluded);
UnitFilterSetState(filter_unit, c_targetFilterStructure,                 c_unitFilterExcluded);
// *** Scan the area for the following, set priority unit when found *** (highest first)
// Priority 4: Melee enemy close to me
// Priority 3: A friendly unit close to death, who has a melee enemy close by
// Priority 2: A friendly ranged unit who has a melee enemy close by
// Priority 1: Large clump of enemies (if we have extra energy)
//
// First check only melee enemies
enemy_count = UnitGroupCount(melee_enemy_group, c_unitCountAll);
while (enemy_count > 0) {
enemy_unit = UnitGroupUnit(melee_enemy_group, enemy_count);
enemy_count = enemy_count - 1;
enemy_position = UnitGetPosition(enemy_unit);
enemy_distance = DistanceBetweenPoints(havoc_position, enemy_position);
if (enemy_distance <= c_forceFieldMeleeRange) {
best_target_unit = enemy_unit;
best_enemy_position = enemy_position;
best_friend_position = havoc_position;
best_priority = 4;
break;
}
friendly_group = UnitGroupAlliance(player, c_unitAllianceAlly, RegionCircle(enemy_position, c_forceFieldMeleeRange), filter_unit, c_noMaxCount);
friendly_has_melee = AIUnitGroupHasMelee(friendly_group);
friendly_count = UnitGroupCount(friendly_group, c_unitCountAll);
while (friendly_count > 0) {
friendly_unit = UnitGroupUnit(friendly_group, friendly_count);
friendly_count = friendly_count - 1;
friendly_vitality = UnitGetPropertyInt(friendly_unit, c_unitPropVitalityPercent, c_unitPropCurrent);
if (friendly_vitality < 20) {
best_target_unit = enemy_unit;
best_enemy_position = enemy_position;
best_friend_position = UnitGetPosition(friendly_unit);
best_priority = 3;
break;
}
else if (!friendly_has_melee) {
best_target_unit = enemy_unit;
best_enemy_position = enemy_position;
best_friend_position = UnitGetPosition(friendly_unit);
best_priority = 2;
}
}
}
if (best_priority == 0) {
// no dangerous melee units found, split large ranged groups
// filter only ranged units
filter_ai = AIFilter(player);
AISetFilterMelee(filter_ai, c_onlyRanged);
range_enemy_group = AIGetFilterGroup(filter_ai, ground_enemies);
// see if there is a large group nearby to split
force_field_target = AIBestTargetPoint(
range_enemy_group,
6, // min hits
1, // damage base
6.0, // min score
c_forceFieldRadius,
UnitGetPosition(havoc),
c_forceFieldRange,
c_unitAttributeNone
);
if (force_field_target == null) {
return;
}
}
else {
// get a point a bit in front of the enemy to shove him away
enemy_distance = DistanceBetweenPoints(best_friend_position, best_enemy_position);
if (enemy_distance < 2.0) {
force_field_target = PointAlongLine(best_friend_position, best_enemy_position, enemy_distance/2.0);
} else {
force_field_target = PointAlongLine(best_friend_position, best_enemy_position, enemy_distance - 1.0);
}
}
OrderSetTargetPoint(force_field_order, force_field_target);
if (!UnitOrderIsValid(havoc, force_field_order)) {
return;
}
if (UnitGroupCount(AIFindUnits(player, "ForceField", force_field_target, 0.5, 1), c_unitCountAlive) > 0) {
return;
}
AICast(havoc, force_field_order, c_noMarker, c_castHold);

int player = lp_player;
unit ascendant = lp_ascendant;
unitgroup scan_group = lp_scan_group;
const int PsiOrbCooldownId = 0;
unitgroup enemies = UnitGroupFilterAlliance(scan_group, player, c_unitAllianceEnemy, 1);
if (UnitGroupCount(enemies, c_unitCountAlive) == 0) {
return;
}
if (AITactCooldownAllow(ascendant, PsiOrbCooldownId)) {
// Cast Psi Orb
if (AIEvalTacticalData(ascendant, "AscendantPsiOrb")) {
AISetCooldown(ascendant, PsiOrbCooldownId, 5.0);
return;
}
}
//  If we already have a psi orb order, ignore any new orders since psi orb is more important.
//  If we already have a Mind Blast order, ignore any new Mind Blast orders.
if (UnitOrderHasAbil(ascendant, "VoidHighTemplarMindBlast") || UnitOrderHasAbil(ascendant, "VoidHighTemplarPsiOrb")) {
return;
}
// Cast Mind Blast
AIEvalTacticalData(ascendant, "AscendantMindBlast");

include "TriggerLibs/NativeLib"
include "LibCOMI"
void TRC_AIThink_Ascendant(int player, unit ascendant, unitgroup scan_group) {
const int PsiOrbCooldownId = 0;
unitgroup enemies = UnitGroupFilterAlliance(scan_group, player, c_unitAllianceEnemy, 1);
if (UnitGroupCount(enemies, c_unitCountAlive) == 0) {
return;
}
if (AITactCooldownAllow(ascendant, PsiOrbCooldownId)) {
// Cast Psi Orb
if (AIEvalTacticalData(ascendant, "AscendantPsiOrb")) {
AISetCooldown(ascendant, PsiOrbCooldownId, 5.0);
return;
}
}
//  If we already have a psi orb order, ignore any new orders since psi orb is more important.
//  If we already have a Mind Blast order, ignore any new Mind Blast orders.
if (UnitOrderHasAbil(ascendant, "VoidHighTemplarMindBlast") || UnitOrderHasAbil(ascendant, "VoidHighTemplarPsiOrb")) {
return;
}
// Cast Mind Blast
AIEvalTacticalData(ascendant, "AscendantMindBlast");
}
