//--------------------------------------------------------------------------------------------------
//  DebugCallbackGen
//--------------------------------------------------------------------------------------------------
void DebugCallbackGen (int player) {
DebugAI("=====GENETRON=====\n");
DebugMelee(player);
DebugAI("e_mainState = "        + MainStateName(AIState(player, e_mainState))           +
", e_mainSubState = "   + GenetronSubStateName(AIState(player, e_mainSubState)) +
