//--------------------------------------------------------------------------------------------------
//  GenetronOpenArmyInitHard
//--------------------------------------------------------------------------------------------------
int GenetronOpenArmyInitHard (int player, int buildType) {
int armyRoll = 0;
int duration = 0;
if (buildType == e_buildType_Rush) {
armyRoll = RandomInt(0,2);
if (armyRoll <= 1) {
AIAddToStockArmy(player, c_GU_Spitfire, 3);
(player, c_GU_Blaze, 3);
// validation: 675 resources
duration = 320 + RandomInt(-15, 15);
} else {
AIAddToStockArmy(player, c_GU_Spitfire, 7);
// validation: 700 resources
duration = 330 + RandomInt(-15, 15);
}
} else if (buildType == e_buildType_Timing) {
armyRoll = RandomInt(0,2);
if (armyRoll <= 1) {
AIAddToStockArmy(player, c_GU_Spitfire, 3);
AIAddToStockArmy(player, AIPickFrom3(c_GU_Blitzer, c_GU_Equalizer, c_GU_Hornet), 4);
// validation: 1000 resources
duration = 380 + RandomInt(-15, 15);
} else if (armyRoll <= 2){
AIAddToStockArmy(player, c_GU_Spitfire, 2);
AIAddToStockArmyPickFrom2Count(player, c_GU_Spitfire, 5, c_GU_Blaze, 4);
AIAddToStockArmyPickFrom2Count(player, c_GU_Spitfire, 3, AIPickFrom3(c_GU_Blitzer, c_GU_Equalizer, c_GU_Hornet), 2);
// validation: 1025 resources
duration = 400 + RandomInt(-15, 15);
}
} else if (buildType == e_buildType_Power) {
armyRoll = RandomInt(0,2);
if (armyRoll < 1) {
AIAddToStockArmy(player, c_GU_Spitfire, 5);
AIAddToStockArmy(player, c_GU_Blitzer, 3);
AIAddToStockArmyPickFrom2Count(player, c_GU_Spitfire, 3, AIPickFrom3(c_GU_Blitzer, c_GU_Equalizer, c_GU_Hornet), 2);
// validation: 1400 resources
duration = 500 + RandomInt(-15, 15);
} else {
AIAddToStockArmy(player, c_GU_Spitfire, 2);
AIAddToStockArmy(player, c_GU_Blitzer, 5);
AIAddToStockArmyPickFrom2Count(player, c_GU_Spitfire, 3, AIPickFrom3(c_GU_Blitzer, c_GU_Equalizer, c_GU_Hornet), 2);
// validation: 1425 resources
duration = 520 + RandomInt(-15, 15);
}
} else if (buildType == e_buildType_Macro) {
armyRoll = RandomInt(1,4);
if (armyRoll <= 3) {
AIAddToStockArmy(player, c_GU_Spitfire, 2);
AIAddToStockArmy(player, c_GU_Blitzer, 3);
// validation: 725 resources
duration = 220 + RandomInt(-15, 15);
} else if (armyRoll <= 4) {
AIAddToStockArmy(player, c_GU_Spitfire, 4);
AIAddToStockArmy(player, c_GU_Blitzer, 2);
// validation: 750 resources
duration = 220 + RandomInt(-15, 15);
}
} else if (buildType == e_buildType_Air) {
AIAddToStockArmy(player, c_GU_Avenger, 2);
AIAddToStockArmy(player, c_GU_Hornet, 6);
// validation: 1525 resources
duration = 540 + RandomInt(-20, 20);
} else {
return GenetronOpenArmyInitHard(player, e_buildType_Macro);
}
AISetUserInt(player, c_ldNextArmyRoll, armyRoll);
return duration;
}
